import React from 'react';
import emailjs from 'emailjs-com';
import {
  Container,
  FormWrap,
  Icon,
  FormContent,
  Form,
  FormH1,
  FormLabel,
  FormInput,
  FormButton,
  MessageInput,
} from './ContactElements';

const SERVICE_ID = 'service_pkfoe6o';
const TEMPLATE_ID = 'template_dw6qj0n';
const USER_ID = 'user_sV424rDcNiK8zdAEz0n3C';

const SignIn = () => {
  const handleOnSubmit = (e) => {
    e.preventDefault();
    emailjs.sendForm(SERVICE_ID, TEMPLATE_ID, e.target, USER_ID).then(
      (result) => {
        console.log(result.text);
      },
      (error) => {
        console.log(error.text);
      }
    );
    e.target.reset();
  };

  return (
    <>
      <Container>
        <FormWrap>
          <Icon to='/'>proshops.co.nz</Icon>
          <FormContent>
            <Form action='#'>
              <FormH1>Get in touch</FormH1>
              <FormLabel>Email</FormLabel>
              <FormInput
                type='email'
                label='Email'
                id='form-input-control-email'
                name='user_email'
                placeholder='Email…'
                required
              />
              <FormLabel>Message</FormLabel>
              <MessageInput
                type='message'
                id='form-input-control-last-name'
                label='Message'
                name='user_message'
                placeholder='Message…'
                required
              />
              <FormButton type='submit' onClick={(e) => handleOnSubmit(e)}>
                Send Message
              </FormButton>
            </Form>
          </FormContent>
        </FormWrap>
      </Container>
    </>
  );
};

export default SignIn;
